// Proto file describing feed attribute type.

// Container for enum describing possible data types for a feed attribute.
message FeedAttributeTypeEnum {
  // Possible data types for a feed attribute.
  enum FeedAttributeType {
    // Not specified.
    UNSPECIFIED = 0;

    // Used for return value only. Represents value unknown in this version.
    UNKNOWN = 1;

    // Int64.
    INT64 = 2;

    // Double.
    DOUBLE = 3;

    // String.
    STRING = 4;

    // Boolean.
    BOOLEAN = 5;

    // Url.
    URL = 6;

    // Datetime.
    DATE_TIME = 7;

    // Int64 list.
    INT64_LIST = 8;

    // Double (8 bytes) list.
    DOUBLE_LIST = 9;

    // String list.
    STRING_LIST = 10;

    // Boolean list.
    BOOLEAN_LIST = 11;

    // Url list.
    URL_LIST = 12;

    // Datetime list.
    DATE_TIME_LIST = 13;

    // Price.
    PRICE = 14;
  }
}
